    #region Xml Write Mixins
    public static class CellXmlTranslationMixIn
    {
        public static void WriteToXml(
            this ICellInternalGetter item,
            XElement node,
            out Cell_ErrorMask errorMask,
            bool doMasks = true,
            Cell_TranslationMask translationMask = null,
            string name = null)
        {
            ErrorMaskBuilder errorMaskBuilder = doMasks ? new ErrorMaskBuilder() : null;
            ((CellXmlWriteTranslation)item.XmlWriteTranslator).Write(
                item: item,
                name: name,
                node: node,
                errorMask: errorMaskBuilder,
                translationMask: translationMask?.GetCrystal());
            errorMask = Cell_ErrorMask.Factory(errorMaskBuilder);
        }

        public static void WriteToXml(
            this ICellInternalGetter item,
            string path,
            out Cell_ErrorMask errorMask,
            Cell_TranslationMask translationMask = null,
            bool doMasks = true,
            string name = null)
        {
            var node = new XElement("topnode");
            WriteToXml(
                item: item,
                name: name,
                node: node,
                errorMask: out errorMask,
                doMasks: doMasks,
                translationMask: translationMask);
            node.Elements().First().SaveIfChanged(path);
        }

        public static void WriteToXml(
            this ICellInternalGetter item,
            Stream stream,
            out Cell_ErrorMask errorMask,
            Cell_TranslationMask translationMask = null,
            bool doMasks = true,
            string name = null)
        {
            var node = new XElement("topnode");
            WriteToXml(
                item: item,
                name: name,
                node: node,
                errorMask: out errorMask,
                doMasks: doMasks,
                translationMask: translationMask);
            node.Elements().First().Save(stream);
        }

    }
